    {
      "lineNumber": 128841,
      "originalJapaneseLine": "「？　別に嘘つくことないでしょ。",
      "translatedEnglishLine": "\"? There's no need to lie, right?"
    },
    {
      "lineNumber": 128842,
      "originalJapaneseLine": "　惚れた男の種で孕みたいと思うのは",
      "translatedEnglishLine": "Wanting to become pregnant with the seed of the man you love"
    },
    {
      "lineNumber": 128843,
      "originalJapaneseLine": "　女の子として、自然なことだわ」",
      "translatedEnglishLine": "is a natural thing as a girl.\""
    },
    {
      "lineNumber": 128844,
      "originalJapaneseLine": "「は、はらっ――！？」",
      "translatedEnglishLine": "\"P-Pregnant――!?\""
    },
    {
      "lineNumber": 128845,
      "originalJapaneseLine": "「？　サテラちゃんはランス君の種で",
      "translatedEnglishLine": "\"? Satella-chan wants to get pregnant with Rance-kun's seed, doesn't she?"
    },
    {
      "lineNumber": 128846,
      "originalJapaneseLine": "　孕みたいんじゃないの？」",
      "translatedEnglishLine": "Isn't that right?\""
    },
    {
      "lineNumber": 128847,
      "originalJapaneseLine": "「あ、あ、あ、ぁ……」",
      "translatedEnglishLine": "\"A-a-a-ah...\""
    },
    {
      "lineNumber": 128848,
      "originalJapaneseLine": "「ほーーーーーう！",
      "translatedEnglishLine": "\"Ho——!\""
    },
    {
      "lineNumber": 128849,
      "originalJapaneseLine": "　なんだなんだ、そうだったのかサテラ！」",
      "translatedEnglishLine": "So that's how it is, Satella!"
    },
    {
      "lineNumber": 128850,
      "originalJapaneseLine": "「がはははははははははははは！",
      "translatedEnglishLine": "\"Gahahahahahahahaha!"
    },
    {
      "lineNumber": 128851,
      "originalJapaneseLine": "　それなら俺様が一肌脱いで――ッ！」",
      "translatedEnglishLine": "Well then, I'll lend a hand myself——!\""
    },
    {
      "lineNumber": 128852,
      "originalJapaneseLine": "「う、うわあああーーん！」",
      "translatedEnglishLine": "\"Waaahhh!\""
    },
    {
      "lineNumber": 128853,
      "originalJapaneseLine": "サテラは逃げ出した。",
      "translatedEnglishLine": "Satella ran away."
    },
    {
      "lineNumber": 128854,
      "originalJapaneseLine": "「あ、行っちまった……」",
      "translatedEnglishLine": "\"Ah, she left...\""
    },
    {
      "lineNumber": 128855,
      "originalJapaneseLine": "「……女の子を苛めるなんて",
      "translatedEnglishLine": "\"...Bullying a girl"
    },
    {
      "lineNumber": 128856,
      "originalJapaneseLine": "　感心しないわよ、ランス君」",
      "translatedEnglishLine": "is not something to be proud of, Rance-kun.\""
    },
    {
      "lineNumber": 128857,
      "originalJapaneseLine": "「お前のせいだろうが！」",
      "translatedEnglishLine": "\"It's your fault!\""
    },
    {
      "lineNumber": 128858,
      "originalJapaneseLine": "「シーザー君も大変ね。",
      "translatedEnglishLine": "\"Caesar-kun, you have it tough too."
    },
    {
      "lineNumber": 128859,
      "originalJapaneseLine": "　追いかけなくて良かったの？」",
      "translatedEnglishLine": "Aren't you glad you didn't chase after her?\""
    },
    {
      "lineNumber": 128860,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"................\""
    },
    {
      "lineNumber": 128861,
      "originalJapaneseLine": "「ああ、何も言わず動くなと言われたから、",
      "translatedEnglishLine": "\"Ah, because I was told not to move or say anything,"
    },
    {
      "lineNumber": 128862,
      "originalJapaneseLine": "　命令違反出来ないのか、大変ね」",
      "translatedEnglishLine": "I can't disobey orders. That's rough.\""
    },
    {
      "lineNumber": 128863,
      "originalJapaneseLine": "ベゼルアイが肩を叩こうとして……",
      "translatedEnglishLine": "Bezel-eye tried to tap his shoulder..."
    },
    {
      "lineNumber": 128864,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 128865,
      "originalJapaneseLine": "身長が足りず腰の辺りをポンポン叩いた。",
      "translatedEnglishLine": "But lacking height, she patted around his waist."
    },
    {
      "lineNumber": 128866,
      "originalJapaneseLine": "「じゃ、サテラちゃんが戻るまで",
      "translatedEnglishLine": "\"Well then, until Satella-chan returns,"
    },
    {
      "lineNumber": 128867,
      "originalJapaneseLine": "　休憩にしましょうか」",
      "translatedEnglishLine": "shall we take a break?\""
    },
    {
      "lineNumber": 128868,
      "originalJapaneseLine": "「シィルちゃん、ロッキー君、",
      "translatedEnglishLine": "\"Seele-chan, Rocky-kun,"
    },
    {
      "lineNumber": 128869,
      "originalJapaneseLine": "　ご飯の用意をして。私はお茶を淹れるから」",
      "translatedEnglishLine": "prepare the meal. I'll make some tea.\""
    },
    {
      "lineNumber": 128870,
      "originalJapaneseLine": "手をパンパン叩き、",
      "translatedEnglishLine": "Clapping her hands,"
    },
    {
      "lineNumber": 128871,
      "originalJapaneseLine": "ベゼルアイはパーティーに的確な指示を飛ばす。",
      "translatedEnglishLine": "Bezel-eye gave precise instructions to the party."
    },
    {
      "lineNumber": 128872,
      "originalJapaneseLine": "「……まったく、仕切り屋な神様だぜ」",
      "translatedEnglishLine": "\"...Really, a bossy goddess.\""
    },
    {
      "lineNumber": 128873,
      "originalJapaneseLine": "「なーなー、心の友よー、",
      "translatedEnglishLine": "\"Hey, hey, my dear friend—"
    },
    {
      "lineNumber": 128874,
      "originalJapaneseLine": "　本当にこのままでいいのか？」",
      "translatedEnglishLine": "is it really okay to stay like this?\""
    },
    {
      "lineNumber": 128875,
      "originalJapaneseLine": "「相手は魔人だぞ？",
      "translatedEnglishLine": "\"The opponent is a demon, you know?"
    },
    {
      "lineNumber": 128876,
      "originalJapaneseLine": "　魔人の意味分かってるか？",
      "translatedEnglishLine": "Do you understand what a demon is?"
    },
    {
      "lineNumber": 128877,
      "originalJapaneseLine": "　人類の永遠の敵だぞ？」",
      "translatedEnglishLine": "They are humanity's eternal enemy.\""
    },
    {
      "lineNumber": 128878,
      "originalJapaneseLine": "「今の内に殺すべきだ」",
      "translatedEnglishLine": "\"We should kill them now while we can.\""
    },
    {
      "lineNumber": 128879,
      "originalJapaneseLine": "「いや、殺そう、すぐ殺そう。世界でほぼ唯一",
      "translatedEnglishLine": "\"No, we must kill them, kill them soon. I'm almost the only one in the world"
    },
    {
      "lineNumber": 128880,
      "originalJapaneseLine": "　魔人と戦える剣の儂も頑張りますよー」",
      "translatedEnglishLine": "who can fight demons with a sword, so I'll do my best too.\""
    },
    {
      "lineNumber": 128881,
      "originalJapaneseLine": "「くくく、アレ見て気づかんのか。",
      "translatedEnglishLine": "\"Heh heh heh, can't you tell by looking at that?"
    },
    {
      "lineNumber": 128882,
      "originalJapaneseLine": "　サテラは俺様に惚れているのだ。",
      "translatedEnglishLine": "Satella has fallen in love with me."
    },
    {
      "lineNumber": 128883,
      "originalJapaneseLine": "　もう完全に落とした状態だ」",
      "translatedEnglishLine": "She's already completely won over.\""
    },
    {
      "lineNumber": 128884,
      "originalJapaneseLine": "「そんな可愛い俺様の女を誰が殺すか」",
      "translatedEnglishLine": "\"Who would kill such a cute woman of mine?\""
    },
    {
      "lineNumber": 128885,
      "originalJapaneseLine": "「はぁーあ、言うと思った……」",
      "translatedEnglishLine": "\"Haah, I knew you'd say that...\""
    },
    {
      "lineNumber": 128886,
      "originalJapaneseLine": "「さーて、いつやるかな。",
      "translatedEnglishLine": "\"Now then, when shall we do it?"
    },
    {
      "lineNumber": 128887,
      "originalJapaneseLine": "　ぐふふふ、楽しみだぞ」",
      "translatedEnglishLine": "\"Gufufufu, I'm looking forward to it.\""
    },
    {
      "lineNumber": 128888,
      "originalJapaneseLine": "「魔人に、石人形に、神に、喋る剣。",
      "translatedEnglishLine": "\"Demons, stone statues, gods, a talking sword."
    },
    {
      "lineNumber": 128889,
      "originalJapaneseLine": "　どれも話に聞いたことはあるけど……",
      "translatedEnglishLine": "I've heard of all of these, but..."
    },
    {
      "lineNumber": 128890,
      "originalJapaneseLine": "　なんとも不思議な一行よねぇ。ﾇﾇﾇ」",
      "translatedEnglishLine": "what a strange group they are. *nnn*\""
    },
    {
      "lineNumber": 128891,
      "originalJapaneseLine": "「異星人が言うな」",
      "translatedEnglishLine": "\"Don't say that, alien.\""
    },
    {
      "lineNumber": 128892,
      "originalJapaneseLine": "「わ、ランス様見て下さい。",
      "translatedEnglishLine": "\"L-Lord Rance, please look."
    },
    {
      "lineNumber": 128893,
      "originalJapaneseLine": "　ここ、船内なのに木が沢山ありますよ」",
      "translatedEnglishLine": "There are so many trees here, even though we're inside the ship.\""
    },
    {
      "lineNumber": 128894,
      "originalJapaneseLine": "「ここは食料ルーム。",
      "translatedEnglishLine": "\"This is the food room."
    },
    {
      "lineNumber": 128895,
      "originalJapaneseLine": "　私達はこの船内で自給自足してるのよ。ﾇﾇﾇ」",
      "translatedEnglishLine": "We are self-sufficient here inside the ship. *nnn*\""
    },
    {
      "lineNumber": 128896,
      "originalJapaneseLine": "「ほう、果物でも採ってるのか？」",
      "translatedEnglishLine": "\"Oh? Are you gathering fruit or something?\""
    },
    {
      "lineNumber": 128897,
      "originalJapaneseLine": "「この木から溢れ出る蜜よ。ﾇﾇﾇ」",
      "translatedEnglishLine": "\"It's honey flowing abundantly from these trees. *nnn*\""
    },
    {
      "lineNumber": 128898,
      "originalJapaneseLine": "「……やっぱりこいつらムシなんじゃ」",
      "translatedEnglishLine": "\"...After all, aren't these guys insects?\""
    },
    {
      "lineNumber": 128899,
      "originalJapaneseLine": "「失礼ね、加工すれば煮たり焼いたりできる",
      "translatedEnglishLine": "\"How rude, if processed it can be boiled or grilled"
    },
    {
      "lineNumber": 128900,
      "originalJapaneseLine": "　特殊な蜜なのよ。",
      "translatedEnglishLine": "it's a special kind of honey.\""
    }
  ]
}

